$('.delete_pendiente').click(function() {
    id = $(this).data('id');
    swal({
            title: "¿Eliminar pendiente?",
            text: "",
            icon: "warning",
            buttons: true,
            dangerMode: true,
        })
        .then((willDelete) => {
            if (willDelete) {
                swal("Espere un momento. Cargando..", {
                    buttons: false,
                    timer: 2000,
                });
                $.ajax({
                    type: 'get',
                    url: "/web/index.php?r=site/deletependiente",
                    data: {
                        "id": id,
                    },
                    success: function(data) {
                        console.log(data);
                        window.location.reload();
                    },
                    error: function(data) {},
                });
            } else {
                swal("El registro no se elimino");
            }
        });


});
$('#update_pendiente').click(function() {
    let id = $('#id_edit').val();
    let name = $('#name_edit').val();
    let date = $('#date_edit').val();
    let cadena = '';
    let error = 0;
    if (date.trim() == "") {
        cadena += "Debe escoger una fecha\n";
        error += 1;
    }
    if (name.trim() == "") {
        cadena += "Debe escribir el pendiente a realizar\n";
        error += 1;
    }
    if (error == 0) {
        swal("Espere un momento. Cargando..", {
            buttons: false,
            timer: 2000,
        });
        $.ajax({
            type: 'get',
            url: "/web/index.php?r=site/updatependiente2",
            data: {
                "id": id,
                "name": name,
                "date": date,
            },
            success: function(data) {
                console.log(data);
                window.location.reload();
            },
            error: function(data) {},
        });
    } else {
        swal("Campos requeridos!", cadena, {
            icon: "warning",
            buttons: {
                confirm: {
                    className: 'btn btn-warning'
                }
            },
        });
    }

});
